import React from 'react'

export default function ProjectList({projects}) {
    return (
        <div>
            <ul>
                {
                    projects.forEach(({projectName,projectStatus}) => (
                        <li>
                        <h1>{projectName}</h1>
                        <h6>{projectStatus}</h6>
                        </li>
                    )
                    )}
            </ul>
        </div>
    )
}
